import React, { useState, useEffect, useRef } from 'react';
import {
  Container,
  Typography,
  Grid,
  Box,
  Fade
} from '@mui/material';
import {
  FavoriteOutlined,
  CelebrationOutlined,
  ChildCareOutlined,
  BusinessOutlined
} from '@mui/icons-material';
import { Audio } from '@sina_byn/re-audio';

const CounterAnimation = ({ target, prefix = '', duration = 2000 }) => {
  const [count, setCount] = useState(0);
  const [isVisible, setIsVisible] = useState(false);
  const elementRef = useRef(null);

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        if (entry.isIntersecting && !isVisible) {
          setIsVisible(true);
        }
      },
      { threshold: 0.5 }
    );

    if (elementRef.current) {
      observer.observe(elementRef.current);
    }

    return () => observer.disconnect();
  }, [isVisible]);

  useEffect(() => {
    if (!isVisible) return;

    const startTime = Date.now();
    const endTime = startTime + duration;

    const updateCount = () => {
      const now = Date.now();
      const progress = Math.min((now - startTime) / duration, 1);

      const easeOutCubic = 1 - Math.pow(1 - progress, 3);
      const currentCount = Math.floor(easeOutCubic * target);

      setCount(currentCount);

      if (now < endTime) {
        requestAnimationFrame(updateCount);
      } else {
        setCount(target);
      }
    };

    requestAnimationFrame(updateCount);
  }, [isVisible, target, duration]);

  return (
    <span ref={elementRef}>
      {prefix}{count}
    </span>
  );
};

const formatTime = (time) => {
  const minutes = Math.floor(time / 60);
  const seconds = Math.floor(time % 60);
  return `${minutes}:${seconds.toString().padStart(2, '0')}`;
};

const Mixes = () => {
  const mixData = [
    {
      id: 1,
      src: encodeURI('/audio/[BraveDown.Com] [Dj Suru - Forever Drive Mix] [1759501976] .mp3'),
      name: 'forever-drive-mix'
    },
    {
      id: 2,
      src: encodeURI('/audio/[BraveDown.Com] [BURN RESIDENCY 2017 – DjSuru] [1759502542] .mp3'),
      name: 'burn-residency-2017'
    },
    {
      id: 3,
      src: encodeURI('/audio/[BraveDown.Com] [Dj Suru - Romania - MazdaSounds] [1759502701] .mp3'),
      name: 'romania-mazda-sounds'
    },
    {
      id: 4,
      src: encodeURI('/audio/[BraveDown.Com] [Dj Suru - Merry Christmas] [1759502930] .mp3'),
      name: 'merry-christmas'
    }
  ];


  return (
    <>
      {/* Hero Section */}
      <Box
        sx={{
          height: '60vh',
          backgroundImage: 'url(/images/banner.jpg)',
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          position: 'relative',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            backgroundColor: 'rgba(0, 0, 0, 0.5)',
          }
        }}
      >
        <Box sx={{ zIndex: 2, textAlign: 'center', color: 'white' }}>
          <Typography variant="h2" sx={{ fontWeight: 'bold', mb: 2 }}>
            Mixuri
          </Typography>
          <Typography variant="h5">
            Ascultă câteva dintre mixurile mele
          </Typography>
        </Box>
      </Box>


      {/* Audio Player Section */}
      <Box sx={{ py: 10, backgroundColor: '#ffffff' }}>
        <Container maxWidth="lg">
          <Typography
            variant="h3"
            sx={{
              textAlign: 'center',
              mb: 6,
              fontWeight: 'bold',
              color: '#000000'
            }}
          >
            Demo Mixuri
          </Typography>

          <Box sx={{ mb: 4 }}>
            {mixData.map((mix, index) => (
              <Box key={mix.id} sx={{ mb: 4, p: 3, border: '1px solid #e0e0e0', borderRadius: 2 }}>
                <Typography variant="h5" sx={{ mb: 1, fontWeight: 'bold' }}>
                  {mix.name}
                </Typography>
                <Typography variant="body2" sx={{ mb: 2, color: '#666' }}>
                  by {mix.writer}
                </Typography>
                <audio
                  controls
                  style={{ width: '100%' }}
                  preload="none"
                >
                  <source src={mix.src} type="audio/mpeg" />
                  Your browser does not support the audio element.
                </audio>
              </Box>
            ))}
          </Box>

          <Typography
            variant="body1"
            sx={{
              textAlign: 'center',
              color: '#666666',
              fontSize: '1.1rem',
              lineHeight: 1.6
            }}
          >
            Acestea sunt doar câteva exemple din repertoriul meu. Pentru fiecare eveniment,
            creez un playlist personalizat în funcție de preferințele dumneavoastră și atmosfera dorită.
          </Typography>
        </Container>
      </Box>
    </>
  );
};

export default Mixes;
